import React, { Component, Fragment } from 'react';
import Nav from './Nav';

class Home extends Component {

    constructor(props){
        super(props);

        this.state = {
            search_input: '',
            list: {p1:'one',p2:'tow'}
        }
    }

    render() {
        return (
            <Fragment>
                <div>
                    
                    <Nav/>
                </div>
            </Fragment>
        )
    }

}

export default Home;
